	(124, 2, 'Важная статья', '&lt;p&gt;Это очень важная статья которую нужно прочитать всем важным людям про важные события важных людей :-)&lt;br&gt;&lt;/p&gt;', '', '', '', '', ''),
	(124, 1, 'Важная статья', '&lt;p&gt;Это очень важная статья которую нужно прочитать всем важным людям про важные события важных людей :-)&lt;/p&gt;', '', '', '', '', ''),
	(126, 1, 'ДРУЗЬЯ, ОГРОМНОЕ ВАМ СПАСИБО, ЗА ВАШ ВЫБОР!', '&lt;p&gt;&lt;img src=&quot;http://atvdoc/image/catalog/news/66.jpg&quot; style=&quot;width: 976px;&quot;&gt;&lt;br&gt;&lt;/p&gt;', '', '', '', '', ''),
	(127, 1, 'Интернет-магазин ATVDOC.RU принял участие на VI СЛАВЯНСКОМ МЕЖДУНАРОДНОМ ЭКОНОМИЧЕСКОМ ФОРУМЕ.', '&lt;p&gt;&lt;iframe frameborder=&quot;0&quot; src=&quot;//www.youtube.com/embed/U435SRKZ7dc&quot; width=&quot;640&quot; height=&quot;360&quot; class=&quot;note-video-clip&quot;&gt;&lt;/iframe&gt;&lt;br&gt;&lt;/p&gt;', '', '', '', '', ''),
	(128, 1, 'ATVDOC.RU стал спонсором студенческого проекта', '&lt;table border=&quot;0&quot; style=&quot;border: 0px; color: rgb(159, 159, 159); font-family: Arial, Helvetica, sans-serif; font-size: 10.5px; text-align: justify; background-color: rgb(255, 255, 255); width: 664px; height: 20px;&quot;&gt;&lt;tbody&gt;&lt;tr&gt;&lt;td style=&quot;font-size: 14px; margin: 0px;&quot;&gt;&lt;p&gt;К нам в компанию обратились студенты БГТУ за помощью в постройке багги с нуля, после описания проекта,&amp;nbsp;команда atvdoc.ru приняла решение помочь студентам в этом деле.&lt;/p&gt;&lt;p&gt;Автомобиль примет участие в соревнованиях BAJA SAE, которые пройдут этой осенью.&amp;nbsp;Это межуниверситетская гонка, основанная обществом инженеров автомобильной промышленности.&amp;nbsp;Команды студентов из различных университетов всего мира собирают маленькие внедорожники и соревнуются на них.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;iframe frameborder=&quot;0&quot; src=&quot;//www.youtube.com/embed/-gA4L35j0gY&quot; width=&quot;640&quot; height=&quot;360&quot; class=&quot;note-video-clip&quot;&gt;&lt;/iframe&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;iframe frameborder=&quot;0&quot; src=&quot;//www.youtube.com/embed/kviLi8aiXQM&quot; width=&quot;640&quot; height=&quot;360&quot; class=&quot;note-video-clip&quot;&gt;&lt;/iframe&gt;&lt;br&gt;&lt;/p&gt;&lt;/td&gt;&lt;/tr&gt;&lt;/tbody&gt;&lt;/table&gt;', '', '', '', '', '');
