INSERT INTO `oc_information_description` (`information_id`, `language_id`, `title`, `description`, `meta_title`, `meta_description`, `meta_keyword`, `meta_h1`) VALUES
	(5, 1, 'Условия соглашения', '&lt;p&gt;\r\n	Условия соглашения&lt;/p&gt;\r\n', '', '', '', ''),
	(6, 1, 'Доставка и оплата', '&lt;h3 style=&quot;font-size: 16px; margin: 7px 0px; padding: 0px; color: rgb(56, 56, 56); font-family: Arial, Tahoma, Georgia, sans-serif;&quot;&gt;&lt;span style=&quot;font-size: medium;&quot;&gt;&lt;b&gt;в &amp;nbsp;любой &amp;nbsp;регион &amp;nbsp;России:&lt;/b&gt;&lt;/span&gt;&lt;/h3&gt;&lt;ul style=&quot;color: rgb(56, 56, 56); font-family: Arial, Tahoma, Georgia, sans-serif; font-size: 14px;&quot;&gt;&lt;li&gt;Для заказа запчастей либо аксессуаров, Вам необходимо на нашем сайте сформировать заказ, поместить интересующие позиции по каталогу для Вашей техники в корзину и оформив заказ. При оформлении желательно указать свой адрес электронной почты(e-mail), после обработки заказа мы ответим Вам о наличии, стоимости, сроках отправки после оплаты и каким способом можно произвести оплату.&lt;/li&gt;&lt;li&gt;Минимальная сумма заказа 1000 рублей.&lt;/li&gt;&lt;li&gt;После обработки заказа, менеджер свяжется с Вами по телефону для уточнения информации по Вашему заказа,&amp;nbsp;либо письмом на указанный Вами e-mail. После этого Вы оплачиваете заказ переводом суммы заказа на карту либо по выставленному счету.&lt;/li&gt;&lt;li&gt;После зачисления оплаты на карту интернет-магазина, мы в течение 1-3 рабочих дней отправляем заказанный Вами товар, при условии наличия данного товара на складе магазина, если интересующие Вас позиции находятся на центральном складе, отправка осуществляется в течении 3-5 рабочих дней, если на склад-восток, отправка осуществляется в течении 7-10 рабочих дней. При этом обязательно уведомляем Вас письмом об отгрузке, где указываем номер оправления и ссылку для отслеживания Вашего заказа, &amp;nbsp;либо звонком по номеру телефона указанному в Вашем заказе.&lt;/li&gt;&lt;/ul&gt;&lt;h2 style=&quot;font-size: 18px; margin-top: 9px; margin-right: 0px; margin-left: 0px; padding: 0px; color: rgb(56, 56, 56); font-family: Arial, Tahoma, Georgia, sans-serif;&quot;&gt;&amp;nbsp;&lt;/h2&gt;&lt;h3 style=&quot;font-size: 16px; margin: 7px 0px; padding: 0px; color: rgb(56, 56, 56); font-family: Arial, Tahoma, Georgia, sans-serif;&quot;&gt;&lt;span style=&quot;font-size: medium;&quot;&gt;г. Брянск:&lt;/span&gt;&lt;/h3&gt;&lt;ul style=&quot;color: rgb(56, 56, 56); font-family: Arial, Tahoma, Georgia, sans-serif; font-size: 14px;&quot;&gt;&lt;li&gt;Вам необходимо заполнить форму заказа на нашем сайте.&lt;/li&gt;&lt;li&gt;Минимальная сумма заказа 1000 рублей.&lt;/li&gt;&lt;li&gt;Дождаться звонка либо письма менеджера интернет-магазина, который подтвердит ваш заказ и согласует с вами сроки доставки.&lt;/li&gt;&lt;li&gt;Предварительно оплатив товар переводом суммы заказа на карту либо по выставленному счету, в последующем получить товар оплатив стоимость пересылки в пункте выдачи по адресу:&amp;nbsp;&lt;strong&gt;г.Брянск, проспект Станке Димитрова 40 «STELS.ЦЕНТР»&lt;/strong&gt;&lt;/li&gt;&lt;/ul&gt;\r\n', '', '', '', ''),
	(3, 1, 'Гарантия', '&lt;p&gt;\r\n	Что то о гарантии&lt;/p&gt;\r\n', '', '', '', ''),
	(7, 1, 'Акции и скидки', '&lt;p&gt;Акции и скидки&lt;br&gt;&lt;/p&gt;', '', '', '', 'Акции и скидки'),
	(4, 1, 'Контактная информация', '&lt;h2&gt;&lt;br&gt;&lt;/h2&gt;&lt;div class=&quot;popup-window popup-window-with-titlebar pop-up forms short&quot;&gt;&lt;form action=&quot;/bitrix/components/altop/forms/script.php&quot; id=&quot;contact_s1_form&quot; enctype=&quot;multipart/form-data&quot;&gt;\r\n    &lt;/form&gt;\r\n&lt;/div&gt;\r\n', '', '', '', '');
