INSERT INTO `oc_manufacturer_description` (`manufacturer_id`, `language_id`, `description`, `description3`, `meta_description`, `meta_keyword`, `meta_title`, `meta_h1`) VALUES
	(7, 1, '', '', 'Suzuki. Запасные части и аксессуары для гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов в Брянске.', 'Suzuki, Брянск, запчасти, гидроцикл, лодочный мотор, мотовездеход, мотоцикл, скутер, снегоход', 'AtvDoc.ru - Suzuki. Запасные части и аксессуары для гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов.', ''),
	(6, 1, '', '', 'Kawasaki. Запасные части и аксессуары для гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов в Брянске.', 'Kawasaki, Брянск, запчасти, гидроцикл, лодочный мотор, мотовездеход, мотоцикл, скутер, снегоход', 'AtvDoc.ru - Kawasaki. Запасные части и аксессуары для гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов.', 'Kawasaki'),
	(9, 1, '&lt;p&gt;&lt;strong&gt;Yamaha&lt;/strong&gt; —&amp;nbsp;японский производитель мототехники. Изначально часть Yamaha Corporation, которая в определённый момент стала также крупнейшим в мире производителем пианино. На сегодняшний день Yamaha - это полная гамма продукции для спорта, активного отдыха и работы - гидроциклы, подвесные лодочные моторы, мотовездеходы, мотоциклы, скутеры, снегоходы, генераторы а также запасные части и аксессуары.&lt;/p&gt;', '', 'Yamaha. Запасные части и аксессуары для гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов в Брянске.', 'Yamaha, Брянск, запчасти, гидроцикл, лодочный мотор, мотовездеход, мотоцикл, скутер, снегоход', 'AtvDoc.ru - Yamaha. Запасные части и аксессуары для гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов.', 'Yamaha'),
	(10, 1, '&lt;p class=&quot;BasicParagraph&quot;&gt;Независимо от вида Вашего транспортного средства, у нас всегда есть для него подходящая батарея.&lt;/p&gt;\r\n&lt;p class=&quot;BasicParagraph&quot;&gt;Посмотрите, как ассортимент VARTA поможет Вам получить максимальное удовольствие от поездки – на мотоцикле, вездеходе, гидроцикле, мотовездеходе, снегоходе или же современнейшей газонокосилке-райдере.&lt;/p&gt;', '', 'Varta. Аксессуары для гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов в Брянске.', 'Varta, Брянск, аксессуары, гидроцикл, мотовездеход, мотоцикл, скутер, снегоход', 'AtvDoc.ru - Varta. Аксессуары для гидроциклов, мотовездеходов, мотоциклов, скутеров и снегоходов.', 'VARTA'),
	(8, 1, '&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: large;&quot;&gt;&lt;img src=&quot;/pubfiles/img/zavod.jpg&quot; width=&quot;916&quot; height=&quot;233&quot;&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;Холдинг &quot;Веломоторс&quot; - российская машиностроительная компания, крупный российский производитель велосипедов, скутеров, мотоциклов, мотороллеров и комплектующих к ним под торговой маркой &quot;STELS&quot;. С появлением в ассортименте выпускаемой продукции линейки утилитарных и спортивных квадроциклов, холдинг &quot;Веломоторс&quot; вышел на принципиально новый уровень производства ATV и UTV техники для работы и развлечений. Привлекательная цена и исключительная надёжность - вот два ключевых момента, которые позволяют бренду &quot;STELS&quot; доминировать на отечественном рынке, предлагая принципиально новые для российского сегмента модели и разработки, успешно конкурирующие с японскими и американскими аналогами.&lt;/p&gt;\r\n&lt;p style=&quot;text-align: justify;&quot;&gt;&lt;img src=&quot;/pubfiles/img/zavod-br-.jpg&quot; width=&quot;225&quot; height=&quot;149&quot;&gt;&amp;nbsp;&lt;img src=&quot;/pubfiles/img/zavod-br2-.jpg&quot; width=&quot;225&quot; height=&quot;149&quot;&gt;&amp;nbsp;&lt;img src=&quot;/pubfiles/img/zavod-br3-.jpg&quot; width=&quot;225&quot; height=&quot;149&quot;&gt;&amp;nbsp;&lt;img src=&quot;/pubfiles/img/thumbnail_640x360_001.png&quot; width=&quot;225&quot;&gt;&lt;/p&gt;', '', 'Stels. Запасные части и аксессуары для квадроциклов, гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов в Брянске.', 'Stels, Брянск, запчасти, квадроцикл, гидроцикл, лодочный мотор, мотовездеход, мотоцикл, скутер, снегоход', 'AtvDoc.ru - Stels. Запасные части и аксессуары для квадроциклов, гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов.', 'STELS'),
	(5, 1, '', '', 'Irbis, Брянск, запчасти, гидроцикл, лодочный мотор, мотовездеход, мотоцикл, скутер, снегоход', '', 'Irbis. Запасные части и аксессуары для гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов в Брянске.', 'AtvDoc.ru - Irbis. Запасные части и аксессуары для гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов.'),
	(11, 1, '', '', 'Cectek, Брянск, запчасти, гидроцикл, лодочный мотор, мотовездеход, мотоцикл, скутер, снегоход', '', 'Cectek. Запасные части и аксессуары для гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов в Брянске.', 'AtvDoc.ru - Cectek. Запасные части и аксессуары для гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов.'),
	(12, 1, '', '', 'Polaris. Запасные части и аксессуары для гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов в Брянске.', 'Polaris, Брянск, запчасти, гидроцикл, лодочный мотор, мотовездеход, мотоцикл, скутер, снегоход', 'AtvDoc.ru - Polaris. Запасные части и аксессуары для гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов.', ''),
	(13, 1, '', '', 'Arctic Cat, Брянск, запчасти, гидроцикл, лодочный мотор, мотовездеход, мотоцикл, скутер, снегоход', '', 'Arctic Cat. Запасные части и аксессуары для гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов в Брянске.', 'AtvDoc.ru - Arctic Cat. Запасные части и аксессуары для гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов.'),
	(14, 1, '', '', 'BRP, Брянск, запчасти, гидроцикл, лодочный мотор, мотовездеход, мотоцикл, скутер, снегоход', '', 'BRP. Запасные части и аксессуары для гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов в Брянске.', 'AtvDoc.ru - BRP. Запасные части и аксессуары для гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов.'),
	(15, 1, '', '', 'Stels, Брянск, запчасти, квадроцикл, гидроцикл, лодочный мотор, мотовездеход, мотоцикл, скутер, снегоход', '', 'Stels. Запасные части и аксессуары для квадроциклов, гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов в Брянске.', 'AtvDoc.ru - Stels. Запасные части и аксессуары для квадроциклов, гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов.'),
	(16, 1, '&lt;p&gt;Deestone Milestone – тайландская компания, выпускающая шины для квадроциклов и мотоциклов. В сегодняшние дни продукция этой компании пользуется большим спросом в США, Канаде, во всех европейских странах и в Австралии. Пик популярности производителю шин Deestone принесли модели резины для бездорожья Swamp Witch и Outlaw, заработавшие безупречную репутацию благодаря своей износоустойчивости и отличным тяговым свойствам. Компания Deestone была основана более 30 лет назад. Уверенность в безопасности и качество является самым важным для Deestone. Deestone импортируют более 90 стран.&lt;br&gt;&lt;/p&gt;', '', '', '', '', ''),
	(17, 1, '&lt;p&gt;Cпутниковая поисковая, автономная система FindMe - это независимая система обнаружения мобильных объектов, разработанная компанией iRZ.&lt;br&gt;&lt;/p&gt;', '', 'FindMe. Аксессуары для гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов в Брянске.', 'FindMe, Брянск, запчасти, гидроцикл, лодочный мотор, мотовездеход, мотоцикл, скутер, снегоход', 'AtvDoc.ru - FindMe. Аксессуары для гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов.', ''),
	(18, 1, '&lt;p&gt;KENDA является одним из крупнейших мировых производителей велосипедных и мотоциклетных покрышек и камер. Помимо изделий, продающихся под маркой «KENDA», на заводах фирмы также производятся покрышки и камеры для других брендов. За 45 лет своего существования KENDA выпустила больше продукции, чем несколько других крупных фирм, вместе взятых.&lt;br&gt;&lt;/p&gt;', '', 'Kenda. Аксессуары для гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов в Брянске.', 'Kenda, Брянск, запчасти, гидроцикл, лодочный мотор, мотовездеход, мотоцикл, скутер, снегоход', 'AtvDoc.ru - Kenda. Аксессуары для гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов.', ''),
	(19, 1, '&lt;p&gt;Продукция LIQUI MOLY – это современный, отлично сбалансированный комплекс моторных и трансмиссионных масел, смазочных материалов, автохимии и средств ухода за автомобилем, имеющий в своем составе большое количество уникальных компонентов. Эффективность, инновационность и, вместе с тем, бережное отношение к технике и окружающей среде отличают продукцию фирмы LIQUI MOLY что доказано неоднократными победами в различных тестах. Вся продукция производится исключительно в Германии, она сертифицирована и максимально защищена от подделок. Собственное современное производство, расположенное в Западной Германии производит продукцию для всего мира, что является важным преимуществом перед другими, так как позволяет с немецкой педантичностью поддерживать стабильно высокий уровень качества, не только самой продукции, но и всех процессов.&lt;br&gt;&lt;/p&gt;', '', 'Liqui Moly. Аксессуары для гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов в Брянске.', 'Liqui Moly, Брянск, запчасти, гидроцикл, лодочный мотор, мотовездеход, мотоцикл, скутер, снегоход', 'AtvDoc.ru - Liqui Moly. Аксессуары для гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов.', ''),
	(20, 1, '&lt;p&gt;LS2 всегда стремится только вперед. ЭТО ЕДИНСТВЕННЫЙ СПОСОБ войти в историю и зайти как можно дальше. Инвестиции в НИОКР, как педаль газа. Это дает нам возможность сделать две вещи: двигаться быстрее чем другие и вести за собой больше последователей. Вздымать землю, чтобы быть эталоном.&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;line-height: 1.42857;&quot;&gt;Нами движет страсть. Наши техники, инженеры и дизайнеры делают все возможное, чтобы делать самые лучшие шлемы.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;line-height: 1.42857;&quot;&gt;Мы стремимся навстречу клиентам. Клиенты — наша цель. Мы работаем на мировом рынке и присутствуем в каждой стране. Мы не замечаем препятствий на своем пути. Где бы не были наши клиенты, мы найдем их, чтобы дать то, что они ищут.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;line-height: 1.42857;&quot;&gt;Все это непрерывный путь без пит-стопов: от работы к качеству и от качества к успеху. Это наша формула успеха. Наш образ мышления и действия.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;line-height: 1.42857;&quot;&gt;Мотошлемы LS2 имеют внушительный список соответствия мировым стандартам безопасности приятыv в разных странах планеты:&amp;nbsp;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Американо-канадские DOT FMVSS218, ECE, CPSC; Европейские ECE R22.05, EN1077, EN1078, EN1384; Азиатские GB811-1998, JIS T 8133:2007, KS , AS1698:2006 , MS, SGP.&lt;/p&gt;', '', 'LS2. Аксессуары для гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов в Брянске.', 'LS2, Брянск, запчасти, гидроцикл, лодочный мотор, мотовездеход, мотоцикл, скутер, снегоход', 'AtvDoc.ru - LS2. Аксессуары для гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов.', ''),
	(21, 1, '&lt;p&gt;На протяжении многих лет компания Motul выстраивала корпоративную культуру и развивала свои собственные ценности. Являясь больше чем элементами имиджа бренда, эти принципиальные ценности могут быть отслежены во взаимоотношениях Группы со своими клиентами, поставщиками, персоналом и партнерами:&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &lt;b&gt;&amp;nbsp; Высокие технологии • Опыт • Подлинность • Приверженность&lt;/b&gt;&lt;/p&gt;', '', 'Motul. Аксессуары для гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов в Брянске.', 'Motul, Брянск, запчасти, гидроцикл, лодочный мотор, мотовездеход, мотоцикл, скутер, снегоход', 'AtvDoc.ru - Motul. Аксессуары для гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов.', ''),
	(22, 1, '&lt;p&gt;От создания нашего первого кофра Tamarack Quad Trunk в 1997 году, до выпуска новой серии кофров Tamarack Titan Series, основными задачами компании Tamarack являются поддержание наивысших стандартов качества, обслуживания, инноваций и дизайна. Предлагая самый большой ассортимент кофров и сумок, Tamarack производит модели разного ценового диапазона, что позволяет удовлетворить потребности каждого покупателя.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Если вы ищете самые современные аксессуары для квадроциклов, то можете остановиться. Разочарование от низкого качества всегда приходит после радости от низкой цены. &amp;nbsp; Когда Вы заказываете сумку или кофр Tamarack, Вы можете быть уверены, что этот товар прослужит Вам гораздо дольше, чем Ваш квадроцикл. &amp;nbsp; Вы будете удовлетворены на все 100%!&lt;/p&gt;', '', 'Tamarack. Аксессуары для гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов в Брянске.', 'Tamarack, Брянск, запчасти, гидроцикл, лодочный мотор, мотовездеход, мотоцикл, скутер, снегоход', 'AtvDoc.ru - Tamarack. Аксессуары для гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов.', ''),
	(23, 1, '&lt;p&gt;Компания T-MAX (HANGZHOU) INDUSTRIAL CO., LTD основана в 1992 году. На сегодняшний день T-MAX — одна из самых быстроразвивающихся компаний в области производства автомобильных лебедок. Ориентированная на международный рынок, компания Т-МAX обеспечивает свой объем экспорта с приростом более чем на 30% в год.&lt;br&gt;&lt;/p&gt;', '', 'T-max. Аксессуары для гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов в Брянске.', 'T-max, Брянск, запчасти, гидроцикл, лодочный мотор, мотовездеход, мотоцикл, скутер, снегоход', 'AtvDoc.ru - T-max. Аксессуары для гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов.', ''),
	(24, 1, '&lt;p&gt;Американская компания Carlisle получила известность благодаря инновационным разработкам ремней вариатора, которые устанавливаются на большинство моделей, эксплуатирующихся в экстремальных условиях снегоходов и квадроциклов.&lt;/p&gt;&lt;p&gt;\r\n\r\nПоследняя разработка компании Серия приводных ремней ULTIMAX – ремни вариатора на снегоход или квадроцикл двузубой конструкции, которая эффективнее рассеивает тепло и обладает повышенной гибкостью. Инженеры компании утверждает, что такие ремни вариатора нагреваются на 7-10 градусов меньше, чем аналоги с «плоским верхом». Двухсторонняя зубчатая поверхность обеспечивает большую гибкость ремня вариатора и, соответственно, позволяет снизить потери при передаче мощности, а за счёт большей поверхности контакта с щёчками шкивов вариатора, уменьшить проскальзывание ремня, улучшив, тем самым, разгонные характеристики. Вкупе, все внедрённые технические новации привели к увеличению моторесурса приводов снегоходов и квадроциклов, на которые установлены ремни вариатора Carlisle.&lt;/p&gt;', '', 'Ultimax. Аксессуары для гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов в Брянске.', 'Ultimax, Брянск, запчасти, гидроцикл, лодочный мотор, мотовездеход, мотоцикл, скутер, снегоход', 'AtvDoc.ru - Ultimax. Аксессуары для гидроциклов, лодочных моторов, мотовездеходов, мотоциклов, скутеров и снегоходов.', ''),
	(25, 1, '&lt;p&gt;SENA Technologies Inc. является ведущим поставщиком устройств Bluetooth связи, включая Bluetooth интерком системы для мотоциклов. С момента своего первого и флагманского продукта, Bluetooth SMH10 интерком гарнитуры для мотоциклетных шлемов,&lt;/p&gt;&lt;p&gt; SENA стала ведущим поставщиком систем связи Bluetooth для активных видов спорта и активного отдыха на свежем воздухе. SENA предлагает свою продукцию по всему миру через свою глобальную сеть дистрибьюторов.\r\nSENA Technologies имеет лучшую систему управления качеством, чтобы удовлетворить ожидания и потребности наших клиентов.&lt;/p&gt;&lt;p&gt; SENA Technologies постоянно работает над улучшением качества продуктов и услуг для клиентов.&lt;/p&gt;', '', '', '', '', ''),
	(26, 1, '&lt;p&gt;Компания Symtec была основана в 1989 году. Сегодня она является бесспорным лидером в производстве гибких нагревательных элементов и контроллеров для них.&lt;br&gt;&lt;/p&gt;', '', '', '', '', ''),
	(27, 1, '&lt;p&gt;DELTA - промышленные аккумуляторные батареи, представленные на российском рынке с 2001 г. Производство расположено в Китае, на крупнейших заводах-партнерах DELTA. Аккумуляторы под маркой DELTA - это высококачественные VRLA батареи (Valve Regulated Lead Acid - свинцово-кислотные батареи с клапанным регулированием) для источников бесперебойного питания, систем связи и коммуникаций, охранно-пожарных систем, медицинского оборудования и других сфер.&amp;nbsp;&lt;br&gt;&lt;/p&gt;', '', '', '', '', ''),
	(28, 1, '', '', '', '', '', ''),
	(29, 1, '&lt;p&gt;Шины и диски марки SUN.F китайского завода Taizhou Taiyangfeng Rubber Co., Ltd, входит в TOP лучших производителей - который выпускает шины и диски ATV на квадроциклы, для мотокросса, для картинга (картов), машин для голфа, газонокосилок, мотоциклов, прицепов, снегоуборочных машин.&lt;/p&gt;&lt;p style=&quot;font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; font-variant-ligatures: normal; orphans: 2; widows: 2;&quot;&gt;На сегодняшний день в ассортименте SUN.F более 250 моделей и размеров шин. Ежегодный выпуск шин достигает более чем 1 200 000 комплектов.&lt;/p&gt;&lt;div style=&quot;font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; font-variant-ligatures: normal; orphans: 2; widows: 2;&quot;&gt;Завод компании имеет площадь в 6000 квадратных метров, из которых более половины производственных площадей. На заводе компании трудится 250 сотрудников.&amp;nbsp;&lt;/div&gt;&lt;div&gt;&amp;nbsp;&lt;/div&gt;&lt;div style=&quot;font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; font-variant-ligatures: normal; orphans: 2; widows: 2;&quot;&gt;&lt;br&gt;Производство сертифицированно:&lt;br&gt;&amp;nbsp;&lt;/div&gt;&lt;div style=&quot;font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; font-variant-ligatures: normal; orphans: 2; widows: 2;&quot;&gt;• ISO9001-2000&lt;/div&gt;&lt;div style=&quot;font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; font-variant-ligatures: normal; orphans: 2; widows: 2;&quot;&gt;• Сертификат CCC&lt;/div&gt;&lt;div style=&quot;font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; font-variant-ligatures: normal; orphans: 2; widows: 2;&quot;&gt;• Сертификат E4&amp;nbsp;&lt;/div&gt;&lt;div style=&quot;font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; font-variant-ligatures: normal; orphans: 2; widows: 2;&quot;&gt;• DOT сертификат&lt;/div&gt;&lt;div &quot;=&quot;&quot;&gt;&amp;nbsp;&lt;/div&gt;&lt;div s=&quot;&quot;&gt;Главными принципами компании SUN.F являются:&lt;br&gt;&amp;nbsp;&lt;/div&gt;&lt;div style=&quot;font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; font-variant-ligatures: normal; orphans: 2; widows: 2;&quot;&gt;1. Клиенты – наше жизненное богатство&lt;/div&gt;&lt;div&gt;2. Качество – наше вечное стремление&lt;/div&gt;&lt;div st=&quot;&quot;&gt;3. Совершенствование технологий&lt;/div&gt;&lt;div&gt;4. Взаимное развитие с клиентами&lt;/div&gt;&lt;p&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/p&gt;', '', '', 'SUN.F, Шины, ATV, Квадроцикл', '', ''),
	(30, 1, '', '', '', '', '', ''),
	(31, 1, '&lt;p&gt;Компания STARCO основана в Дании в 1962 году. В настоящее время STARCO является крупнейшим в Европе производителем и поставщиком шин, колес, камер, комплектных колес, стальных дисков, осей и сдвоенных колес для спецтехники.&lt;br&gt;&lt;/p&gt;', '', '', 'Шины, квадроцикл, STARCO', '', ''),
	(32, 1, '&lt;p&gt;&lt;b&gt;Компания &quot;ALFeco&quot; ведущий производитель &quot;защит картера&quot; &lt;/b&gt;для автомобилей, расширяет свой ассортимент и предлагает вам новый продукт &quot;ALFeco Extreme ATV&quot; Защита на квадроциклы, защитные решетки - кенгурины, снегоотвалы, площадки под лебедку. Весь наш опыт и технологии теперь доступны для всех любителей экстремальной техники ATV.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Покупая квадроцикл, человек может не подозревать о необходимости защиты днища квадроцикла. И в дальнейшей эксплуатации своего АТВ получает тяжелые поломки, после чего приходится делать дорогостоящий ремонт квадроцикла и подолгу ждать запчасти для ATV. На нашем сайте был сделан специальный раздел посвященный поломкам квадроциклов и фото ATV. А в дальнейшем будет создан и форум квадроциклов. Лучше учится на чужих ошибках и правильно защищать днище своего квадроцикла!&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Линейка &quot;ALFeco Exteme ATV&quot; является лидирующим продуктом на рынке по своим характеристика. Защита на квадроциклы еще не когда не была столь технологичной. Теперь Вам не нужно будет думать о защите Вашего четырехколесного друга о нем позаботится наша защита в то время как вы насладитесь Extrem- ом.&lt;/p&gt;', '', '', 'Защита, картера,  ATV, квадроцикл', '', ''),
	(33, 1, '', '', 'АВТОСПАС, лебедки на квадроциклы, аксессуары на квадроциклы', 'АВТОСПАС, лебедки на квадроциклы, аксессуары на квадроциклы', '', ''),
	(34, 1, '&lt;p&gt;Компания Superwinch была основана в 1969 году, начав производство электрических лебедок на небольшой фабрике в штате Коннектикут. Корпоративной философией стало производство надежных, эффективных лебедок, разработанных с учетом пожеланий клиентов и использованием новейших технических решений. Такой подход полностью себя оправдал, и компания, начавшая свое производство с трех моделей «морских» электрических лебедок для яхт и катеров, начала стремительно развиваться. Следующим шагом стало создание уникальных по своей надежности лебедок для автомобилей, а вскоре компания вышла на рынок «тяжелых» лебедок, предназначенных для коммерческого использования.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;За сорок с лишним лет производственные мощности Superwinch выросли в несколько раз. Предприятия компании расположились в США, Великобритании и КНР. Сегодняшний ассортимент компании включает в себя лебедки различного предназначения с тяговыми усилиями от 1000 до 50000 lbs и множество дополнительного оборудования. Приоритетами Superwinch были и остаются инновации, функциональность, качество, сервис, цена. Это традиции Superwinch.&lt;/p&gt;', '', 'SUPERWINCH, лебедки и аксессуары', 'SUPERWINCH, лебедки, аксессуары, квадроциклов, ATV, UTV', '', ''),
	(35, 1, '&lt;p&gt;ITP – (INDUSTRIAL TIRE PRODUCTS) является мировым лидером в производстве шин и дисков для мотовездеходов. Компания ITP входит в состав гиганта “Carlisle Tire and Wheel company”, который также успешно занимается производством данных продуктов.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Об этом свидетельствует тот факт, что “Carlisle Tire and Wheel company” является поставщиком на конвейер мировых лидеров по производству ATV, таких как Polaris, Bombardier(CAN-AM). Однако, на новом CAN-AM Renegate, уже устанавливаются шины торговой марки ITP. INDUSTRIAL TIRE PRODUCTS самостоятельная компания, которая с 1982 года занимается производством и разработками только в области колес для ATV, и имеет в своем арсенале наибольшее, по сравнению с конкурентами, количество призов и наград.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Ее продукция имеет престижные сертификаты качества ISO9001, и даже QS9000, что говорит о высоких технологиях производства. Интересен и тот факт, что ITP ведет своеобразную систему разработки своей продукции. Кроме передовых компьютерных технологий, разработчики и управленцы данной компании, также являются квадроциклистами, которые постоянно участвуют во всевозможных акциях и соревнованиях, постоянно находясь в среде обитания своей трудовой деятельности.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Таким образом, видя все проблемы изнутри, они добиваются максимального эффекта в проектировании и производстве своей продукции. Нужно сказать, что ITP законодатель в области колес для квадроциклов и всегда&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Продукция ITP пользуется заслуженным уважением у квадроциклистов во всем мире.&lt;/p&gt;', '', '', '', '', ''),
	(36, 1, '&lt;p&gt;Bike Alert Plc(Великобритания)-один из ведущих поставщиков мотоциклетной индустрии, практически для всей линейки мотоциклов, скутеров и квадроциклов. Фильтры Hiflo Filtro – пользуются спросом во всем мире благодаря своей надежности и высокому качеству. Производство расположено в Тайланде, завод основан в 1955 году.&amp;nbsp;&lt;/p&gt;&lt;p&gt;Hiflofiltro является официальным поставщиком таких авто и мото производителей как BMW, Peugeot, Ford, Toyota, Mazda, Suzuki и Nissan.&lt;/p&gt;&lt;p&gt;Для производства фильтров используются только материалы и сырье высшего качества от известных мировых разработчиков: сталь - &quot;Toyota Tsusho&quot; и &quot;NKK&quot; (Япония), клей -&quot;Henkel&quot; (Германия), бумага - &quot;Ahlstrom&quot; (Финляндия), &quot;Восе&quot; (США) и &quot;Awa&quot; (Япония).&lt;/p&gt;', '', 'Hiflo filtro, фильтры, мото', 'Hiflo filtro, фильтры, мото', '', ''),
	(37, 1, '&lt;p&gt;Компания &quot;PULLER&quot; - производитель высококачественных расходных материалов, запасных частей и аксессуаров для ATV и UTV техники. Вся предлагаемая компанией продукция собственного производства. &amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;В каталоге компании &quot;PULLER&quot; представлен большой ассортимент продукции, расходных материалов, запасных частей и аксессуаров для ATV и UTV техники:&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;тормозные колодки;&lt;/p&gt;&lt;p&gt;пуско-зарядные устройства;&lt;/p&gt;&lt;p&gt;резина для квадроциклов;&lt;/p&gt;&lt;p&gt;и многое другое.&lt;/p&gt;&lt;p&gt;Все расходные материалы, запасные части и аксессуары, &amp;nbsp;отвечают необходимым нормам и требованиям, безопасны и надежны в эксплуатации.&lt;/p&gt;', '', 'Колодки и аксессуары для ATV', 'Колодки ATV UTV', '', ''),
	(38, 1, '&lt;p&gt;Торгово-Промышленная Группа «Риваль» — ведущий производитель аксессуаров и дополнительного оборудования для иномарок, отечественных автомобилей и квадроциклов с 2006 года.&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;line-height: 1.42857;&quot;&gt;Защиты «RIVAL OFF-ROAD» производятся из алюминия для квадроциклов самых известных марок.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;line-height: 1.42857;&quot;&gt;Упрощенная система крепления защиты «RIVAL OFF-ROAD» позволяет без усилий и дополнительных инструментов снять или установить защиту в полевых условиях.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;line-height: 1.42857;&quot;&gt;Для каждой модели защиты для квадроциклов «RIVAL OFF-ROAD» разрабатывается система сливных отверстий, благодаря чему квадроцикл не утяжеляется.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Толщина алюминиевого листа – 4 мм&lt;/li&gt;&lt;li&gt;Увеличенная жесткость за счет глубокого штампа&lt;/li&gt;&lt;li&gt;Сливные отверстия для быстрого стекания воды&lt;/li&gt;&lt;li&gt;Надежная защита важных узлов от повреждений и грязи&lt;/li&gt;&lt;li&gt;Быстрый монтаж/демонтаж в экстремальных условиях&lt;/li&gt;&lt;/ul&gt;', '', '', 'RIVAL, запчасти, квадроциклы, ATV, защита ATV', '', ''),
	(39, 1, '&lt;p&gt;CARLISLE - это глобальная многопрофильная компания, которая разрабатывает, производит и продает широкий спектр продуктов для таких отраслей как, энергетика, сельское хозяйство, строительство, авиастроение, оборонная электроника, медицинская техника, общественное питание, здравоохранение.&lt;br&gt;&lt;/p&gt;', '', '', '', '', ''),
	(40, 1, '', '', '', '', '', ''),
	(41, 1, '&lt;p style=&quot;font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; font-variant-ligatures: normal; orphans: 2; widows: 2;&quot;&gt;&lt;span data-mce-style=&quot;font-size: small;&quot; style=&quot;font-size: small;&quot;&gt;GODZILLA – это торгово-производственная компания, которая разрабатывает, производит и поставляет&lt;strong&gt;&amp;nbsp;аксессуары для квадроциклов, мотовездеходов, снегоходов&lt;/strong&gt;&amp;nbsp;и другой внедорожной техники.&amp;nbsp;&lt;/span&gt;&lt;/p&gt;&lt;h1 style=&quot;font-size: 2em; color: rgb(0, 0, 0); font-family: Verdana, Arial, Helvetica, sans-serif; font-variant-ligatures: normal; orphans: 2; widows: 2;&quot;&gt;&lt;span data-mce-style=&quot;font-size: small;&quot; style=&quot;font-size: small;&quot;&gt;&lt;b&gt;Аксессуары GODZILLA. Наряди своего МОНСТРА.&lt;/b&gt;&lt;/span&gt;&lt;/h1&gt;', '', 'Аксессуары GODZILLA', 'GODZILLA, квадроцикл, моторезина, аксессуары', '', '');
