INSERT INTO `oc_modification` (`modification_id`, `extension_install_id`, `name`, `code`, `author`, `version`, `link`, `xml`, `status`, `date_added`) VALUES
	(2, 5, 'WaterMark by iSenseLabs', 'watermark_isenselabs', 'iSenseLabs', '3.2.2', 'https://isenselabs.com', '<?xml version="1.0" encoding="utf-8"?>\n<modification>\n    <name>WaterMark by iSenseLabs</name>\n    <code>watermark_isenselabs</code>\n    <version>3.2.2</version>\n    <author>iSenseLabs</author>\n    <link>https://isenselabs.com</link>\n    \n    <file path="catalog/model/tool/image.php">\n        <operation error="log">\n            <search regex="true"><![CDATA[~^(\\s*\\$image->resize\\(\\$width, \\$height.*?\\);\\s*)$~mi]]></search>\n            <add position="replace"><![CDATA[$1\n                // Begin WaterMark - from from the modification "WaterMark by iSenseLabs"\n                $this->load->model(\'extension/module/iwatermark\');\n\n                if ($this->model_extension_module_iwatermark->isWatermarkable(DIR_IMAGE . $image_old, $width, $height)) {\n                    $image->iwatermark($this->registry, $this->model_extension_module_iwatermark->getWatermarkSettings());\n                }\n                // End WaterMark - from from the modification "WaterMark by iSenseLabs"\n            ]]></add>\n        </operation>\n\n        <operation error="log">\n            <search regex="true"><![CDATA[~^(\\s*copy\\(DIR_IMAGE \\. \\$image_old, DIR_IMAGE \\. \\$image_new\\);\\s*)$~mi]]></search>\n            <add position="replace"><![CDATA[$1\n                // Begin WaterMark - from from the modification "WaterMark by iSenseLabs"\n                $this->load->model(\'extension/module/iwatermark\');\n\n                if ($this->model_extension_module_iwatermark->isWatermarkable(DIR_IMAGE . $image_old, $width, $height)) {\n                    $image = new Image(DIR_IMAGE . $image_new);\n                    $image->iwatermark($this->registry, $this->model_extension_module_iwatermark->getWatermarkSettings());\n                    $image->save(DIR_IMAGE . $image_new);\n                }\n                // End WaterMark - from from the modification "WaterMark by iSenseLabs"\n            ]]></add>\n        </operation>\n    </file>\n\n    <file path="system/library/image.php">\n        <operation error="log">\n            <search regex="true"><![CDATA[~^(\\s*public function watermark.*?)$~mi]]></search>\n            <add position="replace"><![CDATA[\n                // Begin WaterMark - from the modification "WaterMark by iSenseLabs"\n                public function iwatermark(&$registry, $settings) {\n                    $registry->get(\'load\')->library(\'vendor/isenselabs/watermark/iwatermark\');\n\n                    $this->image = $registry->get(\'iwatermark\')->watermark($this, $settings);\n                }\n                // End WaterMark - from the modification "WaterMark by iSenseLabs"\n            $1]]></add>\n        </operation>\n    </file>\n\n    <file path="system/library/cart/cart.php">\n        <operation error="log">\n            <search regex="true"><![CDATA[~^\\s*(\\$this->db\\s*=\\s*\\$registry->get\\(\'db\'\\);)$~mi]]></search>\n            <add position="replace"><![CDATA[$1\n                // Begin WaterMark - from the modification "WaterMark by iSenseLabs"\n                $registry->get(\'load\')->model(\'extension/module/iwatermark\');\n                $this->model_extension_module_iwatermark = $registry->get(\'model_extension_module_iwatermark\');\n                // End WaterMark - from the modification "WaterMark by iSenseLabs"\n            $1]]></add>\n        </operation>\n\n        <operation error="skip">\n            <search regex="true"><![CDATA[~(=>\\s*\\$product_query->row\\[\'image\'\\],)$~mi]]></search>\n            <add position="replace"><![CDATA[=> $this->model_extension_module_iwatermark->imageSymlinkLinkImage($product_query->row[\'product_id\'], $product_query->row[\'image\'], false, false), // From the modification "WaterMark by iSenseLabs"]]></add>\n        </operation>\n    </file>\n</modification>', 1, '2020-04-05 23:10:16'),
	(3, 6, 'd_opencart_patch', 'd_opencart_patch', 'Dreamvention', '3.0.9', 'http://dreamvention.com', '<?xml version="1.0" encoding="utf-8"?>\n<modification>\n    <name>d_opencart_patch</name>\n    <code>d_opencart_patch</code>\n    <description>Permission fixes in Opencart 3.x</description>\n    <version>3.0.9</version>\n    <author>Dreamvention</author>\n    <link>http://dreamvention.com</link>\n    <file path="admin/controller/user/user_permission.php">\n        <operation error="skip">\n            <search><![CDATA[$path[] = $file . \'/*\';]]></search>\n            <add position="after"><![CDATA[\n            //d_opencart_patch.xml 1\n            $files[] = $file;\n            ]]></add>\n        </operation>\n        <operation error="skip">\n            <search><![CDATA[$permission = substr($controller, 0, strrpos($controller, \'.\'));]]></search>\n            <add position="replace"><![CDATA[\n            //d_opencart_patch.xml 2\n            $permission = (strrpos($controller, \'.\') !== false) ? substr($controller, 0, strrpos($controller, \'.\')) : $controller;\n            ]]></add>\n        </operation>\n    </file>\n    <file path="admin/controller/extension/installer.php">\n        <operation error="skip">\n            <search><![CDATA[$modification_info = $this->model_setting_modification->getModificationByCode($code);]]></search>\n            <add position="after"><![CDATA[\n            //d_opencart_patch.xml 1\n            if (strpos($code, \'d_\') === 0 && $modification_info) {\n                $this->model_setting_modification->deleteModification($modification_info[\'modification_id\']);\n                $modification_info = false; \n            }\n            ]]></add>\n        </operation>\n    </file>\n    <file path="admin/model/setting/extension.php">\n        <operation error="skip">\n            <search><![CDATA[$query = $this->db->query("SELECT * FROM `" . DB_PREFIX . "extension_path` WHERE `extension_install_id` = \'" . (int)$extension_install_id . "\' ORDER BY `date_added` ASC");]]></search>\n            <add position="replace"><![CDATA[\n        //d_opencart_patch.xml 1\n        $query = $this->db->query("SELECT * FROM `" . DB_PREFIX . "extension_install` WHERE `extension_install_id` = \'" . (int)$extension_install_id . "\'");\n\n        $extension = $query->row;\n\n        if(isset($extension[\'filename\']) && strpos($extension[\'filename\'], \'_compiled_\')){\n\n\n            $parts = explode(\'_compiled_\', $extension[\'filename\']);\n            $extension_name = $parts[0];\n            $query = $this->db->query("SELECT * FROM `" . DB_PREFIX . "extension_path` WHERE `extension_install_id` = \'" . (int)$extension_install_id . "\' AND path LIKE \'%".$this->db->escape($extension_name)."%\' ORDER BY `date_added` ASC");\n        }else{\n            $query = $this->db->query("SELECT * FROM `" . DB_PREFIX . "extension_path` WHERE `extension_install_id` = \'" . (int)$extension_install_id . "\' ORDER BY `date_added` ASC");\n        }\n            ]]></add>\n        </operation>\n    </file>\n    <file path="admin/model/setting/modification.php">\n        <operation error="skip">\n            <search><![CDATA[$this->db->query("DELETE FROM `" . DB_PREFIX . "modification` WHERE `extension_install_id` = \'" . (int)$extension_install_id . "\'");]]></search>\n            <add position="replace"><![CDATA[\n        //d_opencart_patch.xml 1\n        $query = $this->db->query("SELECT * FROM `" . DB_PREFIX . "extension_install` WHERE `extension_install_id` = \'" . (int)$extension_install_id . "\'");\n\n        $extension = $query->row;\n\n        if(isset($extension[\'filename\']) && strpos($extension[\'filename\'], \'_compiled_\') !== false){\n\n\n            $parts = explode(\'_compiled_\', $extension[\'filename\']);\n            $extension_name = $parts[0];\n            $this->db->query("DELETE FROM `" . DB_PREFIX . "modification` WHERE `extension_install_id` = \'" . (int)$extension_install_id . "\' AND `name` LIKE \'%".$this->db->escape($extension_name)."%\'");\n\n        }else{\n            $this->db->query("DELETE FROM `" . DB_PREFIX . "modification` WHERE `extension_install_id` = \'" . (int)$extension_install_id . "\'");\n        }\n            ]]></add>\n        </operation>\n    </file>\n    <file path="admin/controller/marketplace/install.php">\n        <operation error="skip">\n            <search><![CDATA[$this->model_setting_extension->deleteExtensionInstall($extension_install_id);]]></search>\n            <add position="replace"><![CDATA[//d_opencart_patch.xml 1 moved down]]></add>\n        </operation>\n    </file>\n    <file path="admin/controller/marketplace/install.php">\n        <operation error="skip">\n            <search><![CDATA[$this->model_setting_modification->deleteModificationsByExtensionInstallId($extension_install_id);]]></search>\n            <add position="after"><![CDATA[\n                //d_opencart_patch.xml 2\n                $this->model_setting_extension->deleteExtensionInstall($extension_install_id);]]></add>\n        </operation>\n    </file>\n    <file path="admin/controller/common/filemanager.php">\n        <operation>\n            <search><![CDATA[$files = glob($directory . \'/\' . $filter_name . \'*.{jpg,jpeg,png,gif,JPG,JPEG,PNG,GIF}\', GLOB_BRACE);]]></search>\n            <add position="replace"><![CDATA[$files = glob($directory . \'/\' . $filter_name . \'*.{jpg,jpeg,svg,png,gif,JPG,JPEG,PNG,GIF}\', GLOB_BRACE);]]></add>\n        </operation>\n        <operation>\n            <search><![CDATA[\'jpg\',]]></search>\n            <add position="after"><![CDATA[\'svg\',]]></add>\n        </operation>\n        <operation>\n            <search><![CDATA[\'image/jpeg\',]]></search>\n            <add position="after"><![CDATA[\'image/svg+xml\',]]></add>\n        </operation>\n    </file>\n    <file path="admin/view/template/common/filemanager.twig">\n        <operation>\n            <search><![CDATA[<img src="{{ image.thumb }}" alt="{{ image.name }}" title="{{ image.name }}" />]]></search>\n            <add position="replace"><![CDATA[<img src="{{ image.thumb }}" alt="{{ image.name }}" title="{{ image.name }}" width="100" height="100" />]]></add>\n        </operation>\n    </file>\n    <file path="admin/view/template/common/header.twig">\n        <operation>\n            <search><![CDATA[</header>]]></search>\n            <add position="before"><![CDATA[\n                <style type="text/css">\n                    a.img-thumbnail{\n                        min-width:100px;\n                    }\n                </style>\n                ]]></add>\n        </operation>\n    </file>\n    <file path="admin/model/tool/image.php">\n        <operation>\n            <search><![CDATA[public function resize($filename, $width, $height) {]]></search>\n            <add position="after"><![CDATA[\n                if (isset($this->request->server[\'HTTPS\']) && (($this->request->server[\'HTTPS\'] == \'on\') || ($this->request->server[\'HTTPS\'] == \'1\'))) {\n                    $server = HTTPS_CATALOG;\n                } else {\n                    $server = HTTP_CATALOG;\n                }\n\n                if ($filename) {\n                    $image_info = @getimagesize(DIR_IMAGE . $filename);\n                    if (!$image_info) {\n                        return $server . \'image/\' . $filename;\n                    }\n                } else {\n                    $filename = "no_image.png";\n                }\n                ]]></add>\n        </operation>\n    </file>\n    <file path="catalog/model/tool/image.php">\n        <operation>\n            <search><![CDATA[public function resize($filename, $width, $height) {]]></search>\n            <add position="after"><![CDATA[\n                if (isset($this->request->server[\'HTTPS\']) && (($this->request->server[\'HTTPS\'] == \'on\') || ($this->request->server[\'HTTPS\'] == \'1\'))) {\n                    $server = HTTPS_SERVER;\n                } else {\n                    $server = HTTP_SERVER;\n                }\n\n                if ($filename) {\n                    $image_info = @getimagesize(DIR_IMAGE . $filename);\n                    if (!$image_info) {\n                        return $server . \'image/\' . $filename;\n                    }\n                } else {\n                    $filename = "no_image.png";\n                }\n                ]]></add>\n        </operation>\n    </file>\n    <file path="system/config/catalog.php">\n        <operation>\n            <search index="1" ><![CDATA[\'view/*/before\' => array(]]></search>\n            <add position="replace" offset="2"><![CDATA[\n                   //    "view/*/before" => array(\n                   //        1000  => \'event/debug/before\'\n                   //    ),\n                ]]></add>\n        </operation>\n        <operation>\n            <search ><![CDATA[\'controller/*/after\'  => array(]]></search>\n            <add position="replace" offset="2"><![CDATA[\n                    //	\'controller/*/after\'  => array(\n                    //\'event/debug/after\'\n                    //)\n                ]]></add>\n        </operation>\n    </file>\n\n</modification>', 1, '2020-05-09 16:19:20'),
	(4, 0, 'd_twig_manager', 'd_twig_manager', 'Dreamvention', '2.0.0', 'http://dreamvention.com', '<?xml version="1.0" encoding="utf-8"?>\n<modification>\n    <name>d_twig_manager</name>\n    <code>d_twig_manager</code>\n    <description>Adds support for twig templating engine</description>\n    <version>2.0.0</version>\n    <author>Dreamvention</author>\n    <link>http://dreamvention.com</link>\n    <file path="system/engine/loader.php">\n        <operation error="skip" info="">\n            <search><![CDATA[$template = new Template($this->registry->get(\'config\')->get(\'template_engine\'));]]></search>\n            <add position="replace"><![CDATA[\n            //d_twig_manager.xml\n            $template = new Template($this->registry->get(\'config\')->get(\'template_engine\'), $this->registry);\n            ]]></add>\n        </operation>\n    </file>\n    <file path="system/library/template.php">\n        <operation error="skip" info="">\n            <search><![CDATA[public function __construct($adaptor) {]]></search>\n            <add position="replace"><![CDATA[\n            //d_twig_manager.xml\n            public function __construct($adaptor, $registry) {\n            ]]></add>\n        </operation>\n        <operation error="skip" info="">\n            <search><![CDATA[$this->adaptor = new $class();]]></search>\n            <add position="replace"><![CDATA[\n            //d_twig_manager.xml\n            $this->adaptor = new $class($registry);\n            ]]></add>\n        </operation>\n    </file>\n    <file path="system/library/template/twig.php">\n        <operation error="skip" info="">\n            <search><![CDATA[private $data = array();]]></search>\n            <add position="after"><![CDATA[\n            //d_twig_manager.xml\n            private $registry = array();\n            ]]></add>\n        </operation>\n        <operation error="skip" info="">\n            <search><![CDATA[public function __construct() {]]></search>\n            <add position="replace"><![CDATA[\n            //d_twig_manager.xml\n            public function __construct($registry) {\n            ]]></add>\n        </operation>\n        <operation error="skip" info="">\n            <search><![CDATA[\\Twig_Autoloader::register();]]></search>\n            <add position="after"><![CDATA[\n            //d_twig_manager.xml\n            $this->registry = $registry;\n            ]]></add>\n        </operation>\n        <operation error="skip" info="">\n            <search><![CDATA[$this->twig = new \\Twig_Environment($loader, $config);]]></search>\n            <add position="after"><![CDATA[\n            //d_twig_manager.xml\n            if (file_exists(DIR_SYSTEM . \'library/template/Twig/Extension/DTwigManager.php\')) {\n                $this->twig->addExtension(new \\Twig_Extension_DTwigManager($this->registry));\n            }\n            ]]></add>\n        </operation>\n    </file>\n    <file path="catalog/controller/event/theme.php">\n        <operation error="skip" info="">\n            <search><![CDATA[$twig = new \\Twig_Environment($loader, $config);]]></search>\n            <add position="after"><![CDATA[\n            //d_twig_manager.xml\n            if (file_exists(DIR_SYSTEM . \'library/template/Twig/Extension/DTwigManager.php\')) {\n                $twig->addExtension(new Twig_Extension_DTwigManager($this->registry));\n            }\n            ]]></add>\n        </operation>\n    </file>\n</modification>', 1, '2020-06-29 13:35:54'),
	(5, 0, 'd_ajax_filter', 'd_ajax_filter', 'Dreamvention.com', '1.1.6', '', '<modification>\n    <name>d_ajax_filter</name>\n    <code>d_ajax_filter</code>\n    <version>1.1.6</version>\n    <author>Dreamvention.com</author>\n    <file path="catalog/model/catalog/product.php">\n        <operation>\n            <search><![CDATA[$query = $this->db->query($sql);]]></search>\n            <add position="before">\n                <![CDATA[\n                if(in_array(__FUNCTION__, array(\'getProductSpecials\'))){\n                    $data[\'filter_special\'] = true;\n                }\n                if(in_array(__FUNCTION__, array(\'getProducts\', \'getProductSpecials\'))){\n                    //d_ajax_filter\n                    $this->load->model(\'extension/module/d_ajax_filter\');\n                    $sql = $this->model_extension_module_d_ajax_filter->prepareAjaxFilter($data, $sql);\n                    //d_ajax_filter\n                }\n                if(in_array(__FUNCTION__, array(\'getTotalProducts\'))){\n                    //d_ajax_filter\n                    $this->load->model(\'extension/module/d_ajax_filter\');\n                    $sql = $this->model_extension_module_d_ajax_filter->prepareAjaxFilterForTotal($data, $sql);\n                    //d_ajax_filter\n                }\n                ]]>\n            </add>\n        </operation>\n        <operation>\n            <search><![CDATA[$query = $this->db->query("SELECT COUNT(DISTINCT ps.product_id) AS total FROM " . DB_PREFIX . "product_special ps LEFT JOIN " . DB_PREFIX . "product p ON (ps.product_id = p.product_id) LEFT JOIN " . DB_PREFIX . "product_to_store p2s ON (p.product_id = p2s.product_id) WHERE p.status = \'1\' AND p.date_available <= NOW() AND p2s.store_id = \'" . (int)$this->config->get(\'config_store_id\') . "\' AND ps.customer_group_id = \'" . (int)$this->config->get(\'config_customer_group_id\') . "\' AND ((ps.date_start = \'0000-00-00\' OR ps.date_start < NOW()) AND (ps.date_end = \'0000-00-00\' OR ps.date_end > NOW()))");]]></search>\n            <add position="replace">\n                <![CDATA[\n                $sql = "SELECT COUNT(DISTINCT ps.product_id) AS total FROM " . DB_PREFIX . "product_special ps LEFT JOIN " . DB_PREFIX . "product p ON (ps.product_id = p.product_id) LEFT JOIN " . DB_PREFIX . "product_to_store p2s ON (p.product_id = p2s.product_id) WHERE p.status = \'1\' AND p.date_available <= NOW() AND p2s.store_id = \'" . (int)$this->config->get(\'config_store_id\') . "\' AND ps.customer_group_id = \'" . (int)$this->config->get(\'config_customer_group_id\') . "\' AND ((ps.date_start = \'0000-00-00\' OR ps.date_start < NOW()) AND (ps.date_end = \'0000-00-00\' OR ps.date_end > NOW()))";\n                //d_ajax_filter\n                    $this->load->model(\'extension/module/d_ajax_filter\');\n                    $sql = $this->model_extension_module_d_ajax_filter->prepareAjaxFilterForTotal(array(\'filter_special\' => true), $sql);\n                    //d_ajax_filter\n\n                $query = $this->db->query($sql);\n]]>\n            </add>\n        </operation>\n    </file>\n    <file path="catalog/model/catalog/isearch.php">\n        <operation>\n            <search><![CDATA[$sql .= \' GROUP BY pd.product_id\';]]></search>\n            <add position="before">\n                <![CDATA[\n                //d_ajax_filter\n                $this->load->model(\'extension/module/d_ajax_filter\');\n                $sql = $this->model_extension_module_d_ajax_filter->prepareAjaxFilter(array(\'filter_name\' => $keywords, \'filter_description\' => \'1\'), $sql);\n                //d_ajax_filter\n                ]]>\n            </add>\n        </operation>\n    </file>\n</modification>', 0, '2020-06-29 14:44:46'),
	(6, 7, 'Упрощенный заказ [Custom Quick Checkout]', 'quickcheckout_oc3', 'opencart3x.ru', '1.9', 'https://opencart3x.ru', '<?xml version="1.0" encoding="UTF-8"?>\n<modification>\n	<name>Упрощенный заказ [Custom Quick Checkout]</name>\n	<code>quickcheckout_oc3</code>\n	<version>1.9</version>\n	<author>opencart3x.ru</author>\n	<link>https://opencart3x.ru</link>\n	<file path="catalog/controller/checkout/cart.php">\n		<operation>\n			<search><![CDATA[public function index() {]]></search>\n			<add position="after"><![CDATA[		\n			if ($this->cart->hasProducts() && $this->config->get(\'quickcheckout_skip_cart\')){\n				$this->response->redirect($this->url->link(\'extension/quickcheckout/checkout\'));\n			}\n            ]]></add>\n		</operation>\n	</file>\n  	<file path="catalog/model/setting/extension.php">\n		<operation>\n			<search trim="true" index="0"><![CDATA[\n				SELECT * FROM " . DB_PREFIX . "extension WHERE `type` =\n			]]></search>\n			<add position="after" trim="false" offset="0"><![CDATA[\n				if ($type == \'payment\' && isset($this->session->data[\'shipping_method\'][\'code\']) && $this->config->get(\'quickcheckout_shipping_reload\')) {\n					$payments = $query->rows;\n\n					$rules = array();\n\n					foreach ($this->config->get(\'quickcheckout_payment2shipping_shippings\') as $shippings) {\n						if (strpos($this->session->data[\'shipping_method\'][\'code\'], $shippings[\'shipping\']) === 0) {\n							$rules[] = $shippings[\'payment\'];\n						}\n					}\n\n					if (!empty($rules)) {\n						foreach ($payments as $idx => $payment) {\n							if (!in_array($payment[\'code\'], $rules)) {\n								unset($payments[$idx]);\n							}\n						}\n\n						$query->rows = $payments;\n					}\n\n					//echo \'<pre>\'.__METHOD__.\' [\'.__LINE__.\']: \'; print_r($rules); echo \'</pre>\';\n					//echo \'<pre>\'.__METHOD__.\' [\'.__LINE__.\']: \'; print_r($this->session->data[\'shipping_method\']); echo \'</pre>\';\n					//echo \'<pre>\'.__METHOD__.\' [\'.__LINE__.\']: \'; print_r($query->rows); echo \'</pre>\';\n				}\n			]]></add>\n		</operation>\n	</file>\n</modification>', 1, '2020-07-08 13:00:22');
